Фабрика RES ITALIA
Стиль Современный
Одинарная межкомнатная&nbsp;дверь, оформленная в современном стиле&nbsp;представлена&nbsp;итальянской фабрикой Res Italia в коллекции Wave. Кракас двери изготовлен из&nbsp;МДФ в рифленой&nbsp;золотистой отделке. Модель Wave может быть выполнена в различных модификациях: двойные или одинарные, распашные или&nbsp;раздвижные двери-купе. Дверная рама включена&nbsp;в цену, дверные ручки в стоимость не входят и рассчитываются дополнительно.&nbsp;Доступен заказ изделия с другими параметрами и вариантами отделки (лакированная, матовая, серебристая или золотистая фольга)&nbsp;

